/**
 * Returns the boost value parsed to a string.
 * 
 * @return the parsed value
 */
private CharSequence getValueString() {
  Float f = new Float(this.value);
  if (f == f.longValue())
    return "" + f.longValue();
  else
    return "" + f;

}

